import { Container } from './styles'
import Modal from "react-modal";

interface NewTimeInputModalProps {
  isOpen: boolean;
  onRequestClose: () => void;
}

export function NewTimeInputModal({isOpen, onRequestClose}:NewTimeInputModalProps) {
  return(
    <Modal
      isOpen={isOpen}
      onRequestClose={onRequestClose}
      overlayClassName="react-modal-overlay"
      className="react-modal-content"
    >
      <Container>
        <h2>Register Time</h2>

        <input
          type="time"
          placeholder="Entry time"
        />
        <input
          type="time"
          placeholder="Launch break"
        />
        <input
          type="time"
          placeholder="Entry time"
        />

        <button type="submit">Register</button>

      </Container>
    </Modal>
  );
}
